import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./components/styles/styles.css";
import Home from "./components/pages/Home";
import Trades from "./components/pages/Trades";
import Analysis from "./components/pages/Analysis";
import Accounts from "./components/pages/Accounts";
import Landing from "./components/pages/Landing";
import Register from "./components/controllers/users/Register";
import Login from "./components/controllers/users/Login";
import { ProtectedRoute } from "./components/controllers/func/functions";

const App = () => {
  return (
    <Router>
      <div className="app">
        <header>{}</header>
        <main>
          <Routes>
            <Route path="/start" element={<Landing />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route
              path="/trades"
              element={
                <ProtectedRoute>
                  <Trades />
                </ProtectedRoute>
              }
            />
            <Route
              path="/analysis"
              element={
                <ProtectedRoute>
                  <Analysis />
                </ProtectedRoute>
              }
            />
            <Route
              path="/accounts"
              element={
                <ProtectedRoute>
                  <Accounts />
                </ProtectedRoute>
              }
            />
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
